INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (1918, 378, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Our Earl Grey loose leaf black tea strikes the perfect balance between body and aroma, making it a deliciously fragrant cup for any time of day. Delicious with or without milk, or even with a slice of lemon.</p>
<p><strong>Origin</strong></p>
<p>A blend of a single-origin, Ceylon black tea base, from the remote Uva region in Sri Lanka, and natural Italian bergamot oil. The natural citrus and pine notes of this particular Ceylon, combined with the bergamot, make it delicately fragrant but with enough of the spicy hit of bergamot to make it a true Earl Grey.</p>
<p><strong>Origin:</strong> Sri Lanka (Ceylon) &amp; Italy (Bergamot Oil)</p>')
GO
