INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (1934, 380, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Our English Breakfast blend was designed for those tea drinkers needing a bit more punch in the morning. Taking its lead from the distinctive rich body of Kenyan black tea, and combining it with loyal breakfast favourites Assam tea and Ceylon tea, this whole leaf black tea brews a robust, golden cup - full in body and wonderful with a dash of milk.</p>
<p><strong>Origin</strong></p>
<p>A blend of three of our favourite single-origin black teas. A traditional base of distinctive and dark Kenyan black tea combined with rich, malty Assam and the more fragrant notes of Ceylon.</p>')
