INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (1956, 384, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Our Jade Tips, or Mao Jian, green tea bags have a clean, vegetal flavour and lingering almond sweetness. A deliciously refreshing, everyday green tea.</p>
<p><strong>Origin</strong></p>
<p>Grown in the Bai Yun or ''White Cloud'' mountains in Hunan, China, these dark, wiry leaves produce a bright, pale green liquor.</p>
<p><strong>Our tea bags</strong></p>
<p>Our whole leaf tea bags are 100% compostable.</p>
<p>Each bag is filled with our best leaves, with plenty of room for the leaves to unfurl. This ensures the best possible flavour.</p>')
