INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (1972, 386, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Our Jasmine Pearls loose leaf green tea is delicate, smooth and irresistibly aromatic. The beautiful, tightly-rolled pearls unfurl to produce a deliciously floral cup of green tea for anytime of day.</p>
<p><strong>Origin</strong></p>
<p>The leaves of this delicate green tea are hand-rolled into a characteristic ''pearl'' shape, before being naturally scented with fresh jasmine flowers. The flowers are picked in the early morning but not until dusk are they scattered amongst the tea leaves, just as the flowers open and start to release their heady fragrance. Over 4 or 5 hours the tea leaves absorb the flavour and fragrance of the blossoms, a process that may be repeated as many as six or seven times to ensure the perfect balance.</p>
<p><strong>Origin:</strong> China</p>')
GO
