INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (1994, 388, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Our loose leaf Lemongrass tea zings with a sweet, lemony freshness that lingers long after drinking. This herbal tea brews a bright yellow, lemony cup - perfect as a refreshing afternoon pick-me-up.</p>
<p><strong>Origin</strong></p>
<p>Our Lemongrass is grown on small farms in northern Thailand. Planted during the rainy season, the stalks are then cut for the first time around three months later. After drying in the fields, it is then re-dried and cut again before being hand-sorted to select the best leaves.</p>
<p><strong>Origin:</strong> Thailand</p>')
