INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2010, 390, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Our ceremonial-grade Matcha green tea powder is made from the young leaves of the first harvest of the year, giving it its vibrant green colour and delicate sweetness. Celebrated for its numerous health benefits, ranging from boosting energy levels, focusing the mind and even speeding up the metabolism, this Matcha is smooth and creamy, making it a delicious base for a latte or even better whisked up on its own.</p>
<p>Origin</p>
<p>This particular Matcha is made from the young leaves of the first harvest of the year which are shaded for 3-4 weeks. The leaves are stone-ground, to create a powdered green tea. All this is done at the Kyoto Obubu Farms, Japan.</p>
<p>Step-by-step brewing instructions included.</p>
<p>Origin: Japan</p>')
