<p>1 x Matcha Green Tea Powder (25g): a creamy, Ceremonial grade Matcha with a delicate sweetness - a delicious base for a latte but even better whisked up on its own.</p>
<p>1 x Matcha Bowl: the perfect bowl to whisk your Matcha, as well as enhance the drinking experience.</p>
<p>1 x Bamboo Whisk: the single most important tool for whisking your Matching into a vibrant froth.</p>
<p>1 x Bamboo Scoop: a simple and beautiful tool for measuring the Matcha powder into your bowl.</p>
<p>+ step-by-step brewing instructions</p>')
