<p><strong>Origin</strong></p>
<p>These juicy, unopened buds, with their characteristic downy hairs, are hand harvested over a short period in early Spring, in Fuding county in Fujian, the home of White Tea in China.</p>
<p>Reinfuse up to 3 times.</p>
<p><strong>Origin:</strong> China</p>')
