INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2146, 404, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>A tea bag for any time of day.</p>
<p><strong>This collection includes:</strong></p>
<p>15 x Brockley Breakfast Tea Bags. These award-winning tea bags are our twist on an English Breakfast blend, named after our South London home. <br />15 x Earl Grey Tea Bags. The perfect balance between body and aroma, making it a deliciously fragrant cup for any time of day. <br />15 x Jade Tips Tea Bags. These award-winning, green tea bags, also known as Mao Jian, have a clean, vegetal flavour and lingering almond sweetness. <br />15 x Wild Rooibos Tea Bags. A caffeine-free, full-bodied, honey-sweet flavour with notes of dried cherries and vanilla. <br />15 x Chamomile Tea Bags. A caffeine-free, fresh, sweet cup with hints of apple and honey.<br />15 x Peppermint Tea Bags. A caffeine-free, deliciously fresh, peppery cup with a cool, minty finish.</p>')
