<p>The unopened silver buds and emerald green leaves are grown and crafted in Fuding county in Fujian, the home of White Tea in China. Grown and crafted in Fuding, the home of white tea, these unopened silver buds and emerald green leaves produce a delicate, pale gold infusion with notes of honey and melon. Well-rounded, yet light and distinctly sweet, this is the perfect introduction to white tea.</p>
