INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2246, 410, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Organic wild berries infused with classic herbs.</p>
<p>Twirl up your taste buds with a brimming burst of organic red fruits, as strawberries and raspberries play with the juiciest blackberries; what can we say? Its pure berry bliss.</p>
<p><strong>Ingredients</strong><br />Hibiscus, apple, spearmint, raspberries, strawberries, blueberries, natural strawberry flavour, natural raspberry flavour<br />Caffeine-free</p>
<p><strong>Provenance</strong><br />These herbs are hand-picked and directly traded from traditional, ethical farms on the hot plains of North Africa and Europe.</p>
<p><strong>Recipes</strong><br />Try this herbal infusion as a cold brew or iced tea for a delicious, summery drink.</p>')
