INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2268, 412, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>Organic black tea from the heart of Ceylon; delicate, floral and refreshing.</p>
<p>Tired? Happy? Sad? Whatever the day, whatever your mood, nothing beats a good glug of Britains favourite brew. Blended with only the finest organic black tea from Ceylon this humble cuppa holds its own and then some.</p>
<p>Looking for a stronger, everyday tea or a decaffeinated black (without the nasty chemicals)? Try the rest of our Ever-So-English family, Ever-So-English Everyday and Ever-So-English Decaf.</p>
<p><strong>Ingredients</strong><br />Black tea<br />Contains caffeine</p>
<p><strong>Provenance</strong><br />These delicate Ceylon tea leaves are lovingly hand-picked and directly traded from traditional, ethical tea plantations in Sri Lanka.</p>
<p><strong>Recipes</strong><br />Have a go at making a delicious iced tea here, or try an English Garden cocktail, and if youre feeling more adventurous this mug of tea cookie recipe will wow your afternoon tea guests.</p>')
