<p>Tired? Happy? Sad? Whatever the day, whatever your mood, nothing beats a good glug of Britains favourite brew. Blended with only the finest organic, CO2 decaffeinated black tea this is a first class cuppa.</p>
<p><strong>CO2 decaffeinated.</strong><br />We gently decaffeinate these tea leaves with CO2, rather than nasty chemicals, to ensure the best flavour and the least harm to the environment.</p>
<p>Looking for an English breakfast or a stronger, everyday tea? Try the rest of our Ever-So-English family, Ever-So-English Breakfast and Ever-So-English Everyday.</p>
<p><strong>Ingredients</strong><br />Black tea<br />CO2 decaffeinated</p>')
