<p>Dust down your best china and silver-up the spoons as you refresh your senses with this elegant blend. Black tea is finely fragranced with bergamot oil and its organic too, dont you know.</p>
<p><strong>Ingredients</strong><br />Black tea, bergamot oil<br />Contains caffeine</p>
<p><strong>Provenance</strong><br />These delicate Ceylon tea leaves are lovingly hand-picked and directly traded from traditional, ethical tea plantations in Sri Lanka.</p>
<p><strong>Recipes</strong><br />Spruce up any gathering with these delicious cocktails; Royal Tea and G&amp;Tea.</p>')
