<p>From breakfast to biscuits and everything in between, this no-nonsense black tea blend is organic, full-bodied and fast the ultimate hit the spot cuppa.</p>
<p>Looking for an English Breakfast or a decaffeinated black (without the nasty chemicals)? Try the rest of our Ever-So-English family, Ever-So-English Breakfast and Ever-So-English Decaf.</p>
<p><strong>Ingredients</strong><br />Black tea<br />Contains caffeine</p>
<p><strong>Provenance</strong><br />These delicate Ceylon and Assam tea leaves are lovingly hand-picked and directly traded from traditional, ethical tea plantations in Sri Lanka and India.</p>')
