<p>Calling all citrus lovers! Brew up a cup of balmy sunshine sent straight from lemon-heaven as organic lemongrass, orange peel and spicy ginger ignite the senses and warm the soul.</p>
<p><strong>Ingredients</strong><br />Lemongrass, orange peel, ginger, natural orange flavour, mandarin flavour<br />Caffeine-free</p>
<p><strong>Provenance</strong><br />These herbs and spices are directly traded from traditional, ethical farms in Sri Lanka.</p>
<p><strong>Recipes</strong><br />No brunch would be complete without this incredible twist on a mimosa. And for our alcohol-free option, our friends at The London Honey Company concocted this zingy Bees Needs cocktail.</p>')
