INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2444, 428, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>A light yet lavish blend of organic green tea; refreshing and vibrant.</p>
<p>Whether youre a green tea lover or shunner, this teas for you. Lighter, brighter and smoother than regular gunpowder blends, this green queen guarantees each cup is brimming with health benefits and antioxidants.</p>
<p><strong>Ingredients</strong><br />Green tea<br />Contains caffeine</p>
<p><strong>Provenance</strong><br />These delicate gunpowder green tea leaves are lovingly hand-picked and directly traded from a single estate, ethical tea plantation in Sri Lanka.</p>
<p><strong>Recipes</strong><br />Learn how to cold brew using these easy instructions or an iced tea here.</p>
