<li>Desiccated Coconut<br />Rich in fatty acids-Supports brain function-Rich in essential nutrients.</li>
<li>Nettle Leaf<br />Traditionally used in skin care -Improves Kidney functions- Improves digestion, Boosts immune system</li>
<li>Ginkgo Biloba<br />Improves cognitive function-boosts energy-improves memory</li>
<li>Freeze-dried Passionfruit<br />Packed with antioxidants, flavonoids, vitamin A, vitamin C, riboflavin, niacin, iron, magnesium, phosphorus, potassium, copper, fibre, and protein</li>
<li>Freeze-dried Pineapple<br />Supports immune system-Anti inflammatory</li>
<li>Calendula Petals<br />Improves oral health-Treats menstrual cramps-Anti inflammatory- Contains antimicrobial &amp; antiviral components</li>
<li>Natural Flavouring</li>
</ul>')
