INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2802, 497, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>A delicate white tea blend, designed using ingredients traditionally believed to promote beautiful skin.</p>
<p><strong>Ingredients</strong></p>
<ul>
<li>White Tea<br />Extremely rich in beautifying anti-oxidants</li>
<li>Hibiscus<br />Rich in Vitamin C</li>
<li>Dandelion leaves<br />Rich in vitamins and minerals, a powerful detoxifying agent</li>
<li>Burdock Root<br />Rich in Iron, Sulphur and B Vitamins, this is a powerful blood tonic used to treat skin conditions</li>
<li>Red Clover<br />Rich in vitamins and minerals, this anti-inflammatory herb is used to treat skin conditions</li>
<li>Rosehip<br />Rich in Vitamin C and Iron, this helps maintain healthy collagen</li>
<li>Apple Pieces<br />Naturally sweet and fruity</li>
<li>Elderberries<br />Elder is reputed to be one of the best herbs to take for antioxidant activity</li>
<li>Rose Petals<br />Traditionally used by the Chinese to beautify the skin. Anti- inflammatory</li>
<li>Orange Peel</li>
<li>Blue Cornflowers<br />Contains antiseptic and healing properties</li>
<li>Natural Blueberry Flavour</li>
</ul>')
