INSERT [dbo].[umbracoPropertyData] ([id], [versionId], [propertyTypeId], [languageId], [segment], [intValue], [decimalValue], [dateValue], [varcharValue], [textValue]) VALUES (2820, 499, 76, NULL, NULL, NULL, NULL, NULL, NULL, N'<p>A delicious herbal tea blend, designed using ingredients traditionally used to aid restful sleep.</p>
<p><strong>Ingredients</strong></p>
<ul>
<li>Rooibos<br />Naturally caffeine free. Rich in vitamins and minerals, particularly magnesium, which is crucial to the healthy function of the nervous system.</li>
<li>Lemon Balm<br />Has anti-stress, nerve relaxant and mild tranquilizer effects.</li>
<li>Chamomile<br />Soothing and relaxing.</li>
<li>Passionflower<br />Calms mental restlessness and overactive brains.</li>
<li>Rose Petals<br />A mild sedative.</li>
<li>Lavender<br />Widely used in aromatherapy, beauty products and herbal remedies for its soporific properties.</li>
<li>Vanilla Flavour</li>
</ul>')
